import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";

const Search = () => {
  const [pesel, setPesel] = useState("");
  const [start_date, setStartDate] = useState("");
  const [end_date, setEndDate] = useState("");
  const [product_name, setProductName] = useState("");
  const [prescriptions, setPrescriptions] = useState([]);

  const getPrescriptionSearchData = () => {
    Axios.post("http://localhost:8080/api/test3", {
      pesel: pesel,
      startDate: start_date,
      endDate: end_date,
      productName: product_name,
    }).then((res) => {
      setPrescriptions(res.data)
      console.log(res.data);
    });
  };
  return (
    <div className="App">
      <Header>Wyszukiwarka Recept</Header>
      <div className="inputsWrapper">
        <div>
          <label>Pesel:</label>
          <input
            type="text"
            name="pesel"
            onChange={(e) => {
              setPesel(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data od:</label>
          <input
            type="date"
            name="start_date"
            onChange={(e) => {
              setStartDate(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data do:</label>
          <input
            type="date"
            name="end_date"
            onChange={(e) => {
              setEndDate(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Nazwa Leku:</label>
          <input
            type="text"
            name="product_name"
            onChange={(e) => {
              setProductName(e.target.value);
            }}
          />
        </div>
      </div>

      <button onClick={getPrescriptionSearchData}>
        getPrescriptionSearchData
      </button>
      {console.log(prescriptions)}
      {prescriptions &&
        prescriptions.map((information) => (
          <div className="medicineTable">
            <div>
              <p>{information.codeEAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.codeEAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.codeEAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.EcodeEANAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.EAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.EAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.EAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.EAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.EAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.EAN}</p> <p>EAN</p>
            </div>
            <div>
              <p>{information.EAN}</p> <p>EAN</p>
            </div>
            {/* <td>{information.EAN} <p>EAN</p></td>
                              <td>{information.jednostka_dawki}<p>EANasdasd</p></td>
                              <td>{information.dawka}<p>EANasdas asdaddassdsd</p></td> */}
            {/* <td>{information.substancja_czynna}</td>
                              <td>{information.nazwa}</td>
                              <td>{information.postac}</td>
                              <td>{information.zawartosc_opakowania}</td>
                              <td>{information.rodzaj_leku}</td>
                              <td>{information.urzedowa_cena_zbytu}</td>
                              <td>{information.cena_hurtowa_brutto}</td>
                              <td>{information.cena_detaliczna}</td>
                              <td>{information.wysokosc_limitu_finansowania}</td>
                              <td>{information.doplata_swiadczeniobiorcy}</td>
                              <td>{information.poziom_odplatnosci}</td>
                              <td>{information.lista_refundacyjna}</td>
                              <td>{information.wskazania}</td> */}
          </div>
        ))}
        </div>
  );
};

export default Search;
